import React, { useState, useEffect } from 'react';

import Toolbar from './toolbar/toolbar';

function MainWrapper() {

  useEffect(() => {
    fetch('/login').then(res => res.json()).then(data => {
      setCurrentTime(data.time);
    });
  }, []);

  return (
    <React.Fragment>
      <Toolbar />
    </React.Fragment>
  );
}

export default MainWrapper;
